    return await axios
      .get(url)
      .then((res) => {
          return res.data[0].url
        //setUrl(res.data[0].url);
      });
  };
  getCats();
  return (
    <div className="cats">
      <img src={url} className="cat_img" alt="" />
    </div>
  );
};

export default Cats;
